var letters = [letterM, letterU, letterD, letterA];

var stats = new Stats(); stats.domElement.style.position = 'absolute';
document.body.appendChild(stats.domElement);

var renderer, camera, scene, world;
var counter = 0;

renderer = new THREE.WebGLRenderer( {
    antialias : true,
    clearColor: 0
} );
document.body.appendChild(renderer.domElement)

camera = new THREE.PerspectiveCamera(45, window.innerWidth / window.innerHeight, 0.01, 4000 );
camera.position.set(0, 45, 840);
controls = new OrbitControls(camera, renderer.domElement);
// controls.maxDistance = 500;

world = new Oimo.World(1 / 60, 1, 2);
world.gravity = new OIMO.Vec3(0, 0, 0);

scene = new THREE.Scene();
scene.add(new THREE.AmbientLight(0x000000));

var lights = [];
lights[0] = new THREE.PointLight( 0xffffff, 1, 0 );
lights[1] = new THREE.PointLight( 0xffffff, 1, 0 );
lights[2] = new THREE.PointLight( 0xffffff, 1, 0 );

lights[0].position.set( 0, 200, 0 );
lights[1].position.set( 100, 200, 100 );
lights[2].position.set( -100, -200, -100 );

scene.add( lights[0] );
scene.add( lights[1] );
scene.add( lights[2] );

for (var i = 0; i < letters.length; i++) {
    letters[i] = new THREE.ObjectLoader().parse(letters[i]);
    // scene.add(letters[i]);
};

var boxes = 300;
var w = 25;

world.clear();
var bodys = [];
var meshs = [];
var counterLetters = 0;

var materialGeom = new THREE.MeshPhongMaterial( {
    wireframe : true, 
    ambient: 0xFFFFFF,
    specular: 0x224d44, 
    shininess: 6, 
    color: 0x333333
} );

var materialLetters = new THREE.MeshPhongMaterial ({
    color: 0xFFFFFF
})

var geoms = [
    new THREE.BufferGeometry().fromGeometry( new THREE.BoxGeometry( w, w, w, 1, 1, 1, [materialGeom], 6 ) ),
    new THREE.BufferGeometry().fromGeometry( new THREE.SphereGeometry( w / 2, 8, 8) ),
    new THREE.BufferGeometry().fromGeometry( new THREE.TorusGeometry( w /2, 3, 8, 16 ) )
    
]

var sizes = [
    new THREE.Vector3(52, 48, 20),
    new THREE.Vector3(25, 33, 20),
    new THREE.Vector3(40, 48, 20),
    new THREE.Vector3(46, 48, 20),
]

for (var i = boxes - 1; i >= 0; i--) {

    x = Math.random() * window.innerWidth - window.innerWidth / 2;
    z = Math.random() * window.innerHeight - window.innerHeight / 2;
    y = Math.random() * window.innerWidth - window.innerWidth / 2;

    // var a = 5;
    // x *= a;
    // z *= a;
    // y *= a;


    if(i % 4 == 0)
    {
        var a = counterLetters % (letters.length);
        meshs[i] = letters[a].clone();
        meshs[i].size = sizes[a]

        bodys[i] = new OIMO.Body({type:'box', size:[meshs[i].size.x, meshs[i].size.y, meshs[i].size.z], pos:[x,y,z], move:true, world:world});
        counterLetters++;
    } else {

        var a = i % (geoms.length);

        var type = a == 1 ? "sphere" : "box";
        var size = a == 1 ? [w / 2 ] : [w, w, w];

        bodys[i] = new OIMO.Body({type: type, size: size, pos:[x,y,z], move:true, world:world});
        meshs[i] = new THREE.Mesh( geoms[a], materialGeom );
    }

    scene.add(meshs[i]);
};

function updateOimoPhysics(force) {

    if(force == null) force = -0.0000625

    var i = bodys.length;
    var mesh;
    var body;

    // console.log(bodys[0].body.linearVelocity);

    while (i--){
        body = bodys[i].body;
        mesh = meshs[i];

        mesh.position.copy(body.getPosition());
        mesh.quaternion.copy(body.getQuaternion());

        var newPosAttraction = new THREE.Vector3();
        newPosAttraction.copy(mesh.position)

        if( Math.abs(body.linearVelocity.x) < 10 || 
            Math.abs(body.linearVelocity.y) < 10 ||
            Math.abs(body.linearVelocity.z) < 10)
        {
            newPosAttraction.copy(mesh.position).multiplyScalar(force * (Math.random() / 10));
        } else {
            newPosAttraction.copy(mesh.position).multiplyScalar(0);
        }

        body.applyImpulse(mesh.position, newPosAttraction);
    }

    world.step();
}


function update()
{
    stats.begin();

    updateOimoPhysics();

    renderer.render(scene, camera);
    stats.end()
    
    requestAnimationFrame(update);
}

